    url: 'https://zerofornothing.com/SignIn',
    type: 'POST',
    data: JSON.stringify({username: username, password: password, check: "null"}),
    headers: {
      'Content-Type': 'application/json'
    },
    error: function(request, error) {
      showErrorInput("Can't connect to server");
